import React, { Component } from "react";
import "../css/lab.css";

class Lab extends Component {
  state = {
    id: "",
    name: "Programming Skill Development",
    details: "Mr. Jhon Doe",
    status: 3,
  };

  render() {
    return (
      <div className="container">
        <div className="text">
          <p className="labname">{this.state.name}</p>
          <p className="labdetails">{this.state.details}</p>
        </div>
        <p
          className={
            this.state.status == 0
              ? "substat sentback"
              : this.state.status == 1
              ? "substat pending"
              : ""
          }
        >
          {this.state.status == 0 ? "Sent Back" : "Sent Back !"}
        </p>
      </div>
    );
  }
}

export default Lab;
